  false,\n\t\"url\": null,\n\t\"notes\": \"In accordance with the current Trapping
  Plan for Sherburne National Wildlife Refuge (Refuge), and based on the knowledge
  of the population levels for the Refuge's resident furbearers and past harvest statistics,
  Sherburne National Wildlife Refuge proposes to offer a nuisance beaver control and
  limited wetland trapping program in FY 2002. It is desirable to offer the public
  an opportunity for wildlife-related recreation which provides management benefits
  to the Refuge where compatible with the Refuge purpose and National Wildlife Refuge
  System mission. A summary of the proposed program is outlined here.\",\n\t\"license_title\":
